    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Pathfinder NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Pathfinder NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, a summary of Refuge resources, and information
    about the management direction. Key planning issues include: management, Refuge
    uses, water resources, water level fluctuations, separated land parcels, invasive
    species, science, partnerships, and staffing.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
